import React from 'react';
import {BlogListLayout,BlogListWrapper,BlogImageHolder,Img,Title,InfoLayout,BlogDate,
    BlogText,BottomLayout,Author,ReadMore
} from './bloglist.style';
import 'bootstrap/dist/css/bootstrap.min.css';
import { BlogList } from '../../../pagedata/BlogPage';

const BlogListPage  = () => {
    return (
        <BlogListWrapper>
        {
            BlogList.map((item,idx) => {
            return <BlogListLayout>
                <BlogImageHolder>
                <Img 
                    src={require("../../../assets/"+item.BlogImage)} 
                    alt=""
                />
            </BlogImageHolder>
            <Title>
            {item.Title} 
            </Title>
            <InfoLayout>
                <BlogDate>
                {item.BlogDate} 
                </BlogDate>
                <Author>
                    {item.Author} 
                </Author>
            </InfoLayout>
            <BlogText>
            {item.BlogText} 
            </BlogText>
            <BottomLayout>
                <ReadMore href="/blogdetails">
                {item.ReadMore} 
                </ReadMore>
            </BottomLayout>
            </BlogListLayout>
            })
            }
        </BlogListWrapper>
    );
}
export default BlogListPage;
